prototype.projection:
result.enabled = false
events.forEach((eventData)=>{
    let event = eventData.data
    switch(eventData.type) {

       	case 'ShippingRequestedEvent':
       		result.enabled = true
    	return;

       	case 'ShippingPreparedEvent':
       		result.enabled = false
    	return;

    }}
  )

events.forEach((eventData)=>{
    let event = eventData.data
    switch(eventData.type) {

       	case 'OrderShippedEvent':

		this.resultList = this.resultList.filter(it => it.deliveryTrackingId !== event.deliveryTrackingId)
    	return;

       	case 'ShippingRequestedEvent':
			this.resultList.push({
			deliveryTrackingId:event.deliveryTrackingId,
			orderId:event.orderId
		})
    	return;


    }
})

events.forEach((eventData)=>{
    let event = eventData.data
    switch(eventData.type) {

       	case 'ShippingPreparedEvent':
			this.resultList.push({
			orderId:event.orderId
		})
    	return;

    }
})

events.forEach((eventData)=>{
    let event = eventData.data
    switch(eventData.type) {

       	case 'FulfillmentPreparedEvent':
       		result.enabled = true
    	return;

    }}
  )

events.forEach((eventData)=>{
    let event = eventData.data
    switch(eventData.type) {

       	case 'FulfillmentPreparedEvent':
			this.resultList.push({
			city:event.city,
			houseNumber:event.houseNumber,
			orderedProducts:event.orderedProducts,
			orderId:event.orderId,
			paymentId:event.paymentId,
			street:event.street,
			totalPrice:event.totalPrice,
			zipCode:event.zipCode,
			name:event.name,
			surname:event.surname
		})
    	return;

       	case 'ShippingPreparedEvent':
			this.resultList = this.resultList.filter(it => it.orderId !== event.orderId)
    	return;

    }
})
